import "./Unit.css";
import { useDispatch } from "react-redux";


export default function Unit(props) {
    const status = props.board;
    let symbol = "";
    const dispatch = useDispatch();
    return (<div className = "white" onClick = {() => dispatch(
        {
            type:"boardClick",
            need:props.index,
            change: symbol,
        }
    )}>{symbol} </div>);
}
